const spriteSets = {
	idle: [[-3, -3]],
	alert: [[-7, -3]],
	scratchSelf: [
		[-5, 0],
		[-6, 0],
		[-7, 0],
	],
	scratchWallN: [
		[0, 0],
		[0, -1],
	],
	scratchWallS: [
		[-7, -1],
		[-6, -2],
	],
	scratchWallE: [
		[-2, -2],
		[-2, -3],
	],
	scratchWallW: [
		[-4, 0],
		[-4, -1],
	],
	tired: [[-3, -2]],
	sleeping: [
		[-2, 0],
		[-2, -1],
	],
	N: [
		[-1, -2],
		[-1, -3],
	],
	NE: [
		[0, -2],
		[0, -3],
	],
	E: [
		[-3, 0],
		[-3, -1],
	],
	SE: [
		[-5, -1],
		[-5, -2],
	],
	S: [
		[-6, -3],
		[-7, -2],
	],
	SW: [
		[-5, -3],
		[-6, -1],
	],
	W: [
		[-4, -2],
		[-4, -3],
	],
	NW: [
		[-1, 0],
		[-1, -1],
	],
};

let mousePosX = 0;
let mousePosY = 0;
document.addEventListener('mousemove', (event) => {
	mousePosX = event.clientX;
	mousePosY = event.clientY;
});

function oneko() {
	let nekoPosX = 32;
	let nekoPosY = 32;

	let frameCount = 0;
	let idleTime = 0;
	let idleAnimation = null;
	let idleAnimationFrame = 0;

	const nekoEl = document.createElement('div');
	nekoEl.id = 'oneko';
	nekoEl.ariaHidden = true;
	nekoEl.style.width = '32px';
	nekoEl.style.height = '32px';
	nekoEl.style.position = 'fixed';
	nekoEl.style.pointerEvents = 'none';
	nekoEl.style.imageRendering = 'pixelated';
	nekoEl.style.left = `${nekoPosX - 16}px`;
	nekoEl.style.top = `${nekoPosY - 16}px`;
	nekoEl.style.zIndex = 2147483647;
	nekoEl.style.backgroundImage =
		'url("data:image/gif;base64,")';

	document.body.appendChild(nekoEl);

	function setSprite(name, frame) {
		const sprite = spriteSets[name][frame % spriteSets[name].length];
		nekoEl.style.backgroundPosition = `${sprite[0] * 32}px ${sprite[1] * 32}px`;
	}

	let lastFrameTimestamp;

	function onAnimationFrame(timestamp) {
		if (!nekoEl.isConnected) return;
		window.requestAnimationFrame(onAnimationFrame);
		if (!lastFrameTimestamp) lastFrameTimestamp = timestamp;
		if (timestamp - lastFrameTimestamp > 100) {
			lastFrameTimestamp = timestamp;
			frameCount += 1;
			const diffX = nekoPosX - mousePosX;
			const diffY = nekoPosY - mousePosY;
			const distance = Math.sqrt(diffX ** 2 + diffY ** 2);

			if (distance < 48) {
				idleTime += 1;

				if (idleTime > 10 && Math.floor(Math.random() * 100) == 0 && idleAnimation == null) {
					let avalibleIdleAnimations = ['sleeping', 'scratchSelf'];
					if (nekoPosX < 32) avalibleIdleAnimations.push('scratchWallW');
					if (nekoPosY < 32) avalibleIdleAnimations.push('scratchWallN');
					if (nekoPosX > window.innerWidth - 32) avalibleIdleAnimations.push('scratchWallE');
					if (nekoPosY > window.innerHeight - 32) avalibleIdleAnimations.push('scratchWallS');
					idleAnimation =
						avalibleIdleAnimations[Math.floor(Math.random() * avalibleIdleAnimations.length)];
				}

				switch (idleAnimation) {
					case 'sleeping':
						if (idleAnimationFrame < 8) {
							setSprite('tired', 0);
							break;
						}
						setSprite('sleeping', Math.floor(idleAnimationFrame / 4));
						if (idleAnimationFrame > 192) {
							idleAnimation = null;
							idleAnimationFrame = 0;
						}
						break;
					case 'scratchWallN':
					case 'scratchWallS':
					case 'scratchWallE':
					case 'scratchWallW':
					case 'scratchSelf':
						setSprite(idleAnimation, idleAnimationFrame);
						if (idleAnimationFrame > 9) {
							idleAnimation = null;
							idleAnimationFrame = 0;
						}
						break;
					default:
						setSprite('idle', 0);
						return;
				}
				idleAnimationFrame += 1;
				return;
			}

			idleAnimation = null;
			idleAnimationFrame = 0;

			if (idleTime > 1) {
				setSprite('alert', 0);
				idleTime = Math.min(idleTime, 7);
				idleTime -= 1;
				return;
			}

			let direction;
			direction = diffY / distance > 0.5 ? 'N' : '';
			direction += diffY / distance < -0.5 ? 'S' : '';
			direction += diffX / distance > 0.5 ? 'W' : '';
			direction += diffX / distance < -0.5 ? 'E' : '';
			setSprite(direction, frameCount);

			nekoPosX -= (diffX / distance) * 10;
			nekoPosY -= (diffY / distance) * 10;

			nekoPosX = Math.min(Math.max(16, nekoPosX), window.innerWidth - 16);
			nekoPosY = Math.min(Math.max(16, nekoPosY), window.innerHeight - 16);

			nekoEl.style.left = `${nekoPosX - 16}px`;
			nekoEl.style.top = `${nekoPosY - 16}px`;
		}
	}
	window.requestAnimationFrame(onAnimationFrame);
}

let recentKeys = [];
document.addEventListener('keydown', (event) => {
	recentKeys.push(event.key.toLowerCase());
	if (recentKeys.length > 10) recentKeys.shift();
	if (recentKeys.join('').endsWith('oneko')) oneko();
	else if (recentKeys.join('').endsWith('boom')) {
		let audio = new Audio(
			'data:audio/mpeg;base64,',
		);
		audio.play();
		const ele = document.body.appendChild(document.createElement('img'));
		ele.src =
			'https://media3.giphy.com/media/v1.Y2lkPTc5MGI3NjExbzFiM3R0b2h3cG0zcnU4eGo2d3diOW9pdHQzNmJ0ZGVmdnZ0b2ZqZyZlcD12MV9pbnRlcm5hbF9naWZfYnlfaWQmY3Q9Zw/XrNry0aqYWEhi/giphy.gif';
		ele.style.position = 'absolute';
		ele.style.zIndex = '10000';
		ele.style.width = '100vw';
		ele.style.height = '100vh';
		ele.style.top = '0';
		setTimeout(() => {
			ele.remove();
		}, 1900);
	} else if (recentKeys.join('').endsWith('doot')) {
		let audio = new Audio(
			'https://cloud-ctlarj8uq-hack-club-bot.vercel.app/0skullsound2_audio.mp4',
		);
		audio.play();
		const ele = document.body.appendChild(document.createElement('img'));
		ele.src = 'https://cloud-11jkf35jk-hack-club-bot.vercel.app/0doot-doot-doot.gif';
		ele.style.position = 'absolute';
		ele.style.zIndex = '10000';
		ele.style.width = '100vw';
		ele.style.height = '100vh';
		ele.style.top = '0';
		audio.onended = () => setTimeout(() => ele.remove(), 100);
	} else if (recentKeys.join('').endsWith('barrelroll')) {
		document.body.style.transitionDuration = '3s';
		document.body.style.transform = 'rotate(360deg)';
		setTimeout(() => {
			document.body.style.transitionDuration = '';
			document.body.style.transform = '';
		}, 3000);
	} else if (recentKeys.join('').endsWith('awesome')) {
		let color = 0;
		setInterval(() => {
			color = (color + 1) % 360;
			document.body.style.setProperty('--color--primary', `hsl(${color}, 100%, 50%)`);
			document.body.style.setProperty('--color--primary--shade-1', `hsl(${color}, 100%, 50%)`);
			document.body.style.setProperty('--link--color--secondary', `hsl(${color}, 100%, 50%)`);
			document.body.style.setProperty(
				'--button--color--background--primary',
				`hsl(${color}, 100%, 50%)`,
			);
			document.body.style.setProperty(
				'--button--border-color--primary',
				`hsl(${color}, 100%, 50%)`,
			);
			document.body.style.setProperty(
				'--switch--color--background--active',
				`hsl(${color}, 100%, 50%)`,
			);
		}, 1);
	}
});
